const Flex = styled.div`
  display:flex;
  flex-direction:column;
  justify-content:center;
  align-items:center;
  gap:1rem;
  margin:auto;
  background-color: ${ (props) => <props className="bebe"></props> || "transparent"};
`;

export default Flex;
